import React from 'react';
import {
  Collapse,
  Container,
  List,
  ListItem,
  ListItemText,
  Paper,
  Typography
} from '@material-ui/core';
// import {
//   ExpandLess,
//   ExpandMore
// } from '@material-ui/icons';

import { familyData, countFamily, countDevices } from '../data';
import EmployeeDetail from './EmployeeDetail';

export default function Content(){
  return(
    <Container>
      <Typography>Summary</Typography>
      <Paper>
        <Typography>Family Members Enrolled: {countEmployees(familyData)}</Typography>
        <Typography>Devices Activated: {countDevices(familyData)}</Typography>
      </Paper>
      <Typography>Enrollment Details</Typography>
      <Paper>
        <List>
        {employeeData.map((employee) =>
          <EmployeeDetail employee={employee} key={employee.id}/>
        )}
        </List>
      </Paper>
    </Container>
  );
};
